import { UALProvider, withUAL } from "ual-reactjs-renderer";
import { Wax } from "@eosdacio/ual-wax";


import { JsonRpc } from "eosjs";

import React from "react";
import logo from "./logo.svg";
import DropListApp from "./components/droplist";

function App() {
  const ourNetwork = {
    chainId: "1064487b3cd1a897ce03ae5b6a865651747e2e152090f99c1d19d44e01aea5a4",
    rpcEndpoints: [{ protocol: "https", host: "wax.greymass.com", port: "443" }],
  };

  const appName = "Drop Listener";


  const wax = new Wax([ourNetwork], {appName});

  const DropListConsumer = withUAL(DropListApp);

  return (
    <UALProvider
      chains={[ourNetwork]}
      authenticators={[wax]}
      appName={appName}
      key={ourNetwork.chainId}
    >
      <DropListConsumer />
    </UALProvider>
  );
}

export default App;
